import React , {Component} from 'react'
import {BrowserRouter as Router, Route, Routes, Link} from 'react-router-dom'
import withNavigation from './WithNavigation.jsx' 
import withParams from './WithParams.jsx'
import AuthenticationService from './AuthenticationService.js'
import AuthenticatedRoute from './AuthenticatedRoute.jsx'
import LoginComponent from './LoginComponent.jsx'



class HeaderComponent extends Component{
    render(){
        const isUserLoggedIn = AuthenticationService.isUserLoggedIn();
        //console.log(isUserLoggedIn)
        return (
            <header>
                <nav className="navbar navbar-expand-md navbar-dark bg-dark">
                    <div><a href="http://www.in28minutes.com" className='navbar-brand'>in28minutes</a></div>
                    <ul className="navbar-nav">
                        {isUserLoggedIn && <li><Link className="nav-link" to="/welcome/in28minutes">Home</Link></li>}
                        {isUserLoggedIn && <li><Link className="nav-link" to="/todos">Todos</Link></li>}
                    </ul>
                    <ul className="navbar-nav navbar-collapse justify-content-end">
                        {!isUserLoggedIn && <li><Link className="nav-link" to="/login">Login</Link></li>}
                        {isUserLoggedIn && <li><Link className="nav-link" to="/logout" onClick={AuthenticationService.logout}>Logout</Link></li>}
                    </ul>
                </nav>
            </header>
        )
    }
}

class FooterComponent extends Component{
    render(){
        return (
            <footer className="footer">
                <span className="text-muted">All Rights Reserved by Vaibhav</span>
            </footer>
        )
    }
}

class LogoutComponent extends Component{
    render(){
        return (
            <div>
                 <h1> You are logged out</h1>
                 <div className="container">
                     Thank you for using our Application.
                 </div>
            </div>
        )
    }
}

class ListTodosComponent extends Component {
    constructor(props){
        super(props)    
        this.state = {
            todos: 
            [{id: 1, description: 'Learn Raect', done: false , targetDate: new Date()},
             {id: 2, description: 'Learn Dance', done: false , targetDate: new Date()}
            ]
        }
    }
    render(){
        return( <div>
                    <h1> List Todos</h1>
                    <div className="container">
                        <table className="table">
                            <thead>
                                <tr>
                                    <th>description</th>
                                    <th>Is completed?</th>
                                    <th>TargetDate</th>
                                </tr>
                            </thead>
                            <tbody>
                            {
                                this.state.todos.map (
                                    todo=> 
                                <tr key={todo.id}>
                                    <td>{todo.description}</td>
                                    <td>{todo.done.toString()}</td>
                                    <td>{todo.targetDate.toString()}</td>
                                </tr>
                                )
                            }
                            </tbody>
                        </table>
                    </div>
                 </div>
        )
    }
}

class WelcomeComponent extends Component {
    render() {
        return (
        <>
        <h1>Welcome!</h1>
        <div className="container"> 
        welcome {this.props.params.name}. You can manage your todos <Link to="/todos">here</Link> 
        </div>
        </>
        )
    }
}



function ErrorComponent() {
    return <div>An Error Occurred. I don't know what to do! Contact support at abcd-efgh-ijkl</div>
}

function ShowInvalidCredentials(props){
    if(props.hasLoginFailed){
        return <div> Invalid Credentials</div>
    }
    return null
}

function ShowLoginSuccessful(props){
    if(props.showSuccessMessage){
        return <div> Login Successful</div>
    }
    return null
}

export default TodoApp;
